function initMap() {
	var location = { lat: 16.496691, lng: 120.487602 };
	var map = new google.maps.Map(document.getElementById("map"), {
		zoom: 11,
		center: location,
	});
	var image = {
		url: "data:image/png;base64,",

		scaledSize: new google.maps.Size(91.5, 133.75),
		origin: new google.maps.Point(0, 0),
		anchor: new google.maps.Point(45.75, 133.75),
	};
	var marker = new google.maps.Marker({
		position: location,
		map: map,
		icon: image,
	});
}
